Proteus 2私たちが開発してきた新しいテクノロジーを利用しています。

私たちは世界のテクスチャの量を2倍にし、何百万もの草の刃を動かし、そして数えない新しい外国人の葉の葉が様々な資源をもたらしました。
;

あなたがあなたの冒険で観察したすべてのものが発見されることができます。単純な実績以上のものではなく、発見システムは実際にはさまざまなリソースをすべてロック解除します。

基本的に、リソース上で使用される各武器またはツールは、異なる項目を生み出すことができ、太陽系およびそのすべての生活形態のより多くの科学的探査を可能にする。
;

ミネラルはあなたの更新されたGPSでフィルタリングされるようになりました。この非常に便利なツール。これは常にあなたのHUDで利用可能で、あなたのロケータに添付されていなくなり、あなたの周囲の衛星とあなた自身の内部スーツのレーダーから読み込み、検出半径を作成します。

このシステムはあなたにすべての周囲のミネラル、彼らの硬さと密度を示すので、あなたがあなたのクラフトミッションであなたが探しているものを見つけることができます。
;

