1-1。身体環境は生存率において重要な役割を果たしています。温度、気象系、地形、先住民族の生活形態はすべて、健康と持続可能性に直接的な影響を与えます。これらの要素を知っていること、および彼らが持っている効果は最も重要です。

1-2。予防策、早期認識、および迅速な治療は、機能性の低下と死亡可能な死亡の可能性を最小限に抑えるのに役立ちます。要するに、意識は重要です。
;

1-5。余分な太陽惑星の地形はフェッチ革人になることができ、注意を払って横断しなければなりません。誤った段階はあなたのEVAのスーツを損傷し、壊滅的な違反につながることにつながる可能性があります。それは細心の注意を払って探索するのが曖昧です。

1-6。スロープ。斜面を登ろうとすると、必ずスロープ警告インジケータを見てください。傾斜または衰退のどちらかで30度を超える斜面のために、あなたのトラバーサルの危険性をもたらします。この不均一な地形でジャンプまたは実行しようとすることはお勧めできません。

必要に応じて極端な斜面を横断するために身をかがめることができます。;

3-1。生活の質はほとんど栄養、水和、そして一般的な健康に依存しています。時間の経過とともに、体調が悪化し、速度と生存に影響を与える可能性があります。怒られていない場合は、敵と渇望が治療されていない場合は、健康と性能が低下する可能性があります。熱や寒さなどの気候条件も効果があります。提供されたスーツの読みを使用してこれらを監視することは不可欠です。

3-2。体調が低下し、健康が損なわれると、特定の種類の食品や包帯を使用して治癒が可能です。命を維持するために癒しは非常に重要です。
;

7-5。 u u手作りは自分自身が他の人員と接触するのを見つけるかもしれません。このような状況では、これらの人員はパーティーやコロニーを設定することによってグループ化することができます。

7-6。パーティーを設定する：パーティーを作成する担当者のために、彼らは他の手術を行って、それらを見てから[F]を押して招待する必要があります。当事者に参加する担当者は、そしてインバータを見て、メニューの[承諾]をクリックする必要があります。
